import React from "react";
import './Estilos/Media.css';
import ImageSlider from "./Image_slider";
import VideoSlider from "./Video_slider";
import { obtenerFotosEnCarpeta } from "./Obtener-fotos";


function Media() {

    const carpetaFotos = '/fotos';
    const images = obtenerFotosEnCarpeta(carpetaFotos);

    const videos = [
        'https://www.youtube.com/watch?v=gV4tXJjxDa4',
        'https://www.youtube.com/watch?v=o4mvnoW_v7k',
        'https://www.youtube.com/watch?v=gV4tXJjxDa4',
        'https://www.youtube.com/watch?v=o4mvnoW_v7k',

        // // Agrega más URLs de imágenes según sea necesario
    ];

    return (
        <div className='Media' >
            <div>
                <ImageSlider images={images} />
            </div>
            <div>
                <VideoSlider videos={videos} />
            </div>
        </div >
    );
}

export default Media;
